import React from 'react'
import ProjsItem from "./projsItem/projsItem";

const ViewReports = props => (
    <div>
        {props.reps.map((rep,cur, index) => {
            return(
                <ProjsItem
                    rep={rep}
                    cur={cur}
                />
            )
        })}
    </div>
)
export default ViewReports
